function Post(props) {
    return(
        <div>
            <h1>{props.title}</h1>
            <h2>{props.author}</h2>
            <p>{props.body}</p>
            <ul>
                <li>{props.comments}</li>
            </ul>
        </div>
    );
}

export default Post;
